ultiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>'કસ્ટમ વર્ગીકરણ પેટી દર્શાવે છે. કેટેગરીઝ અને ટેગ્સની જેમ, વર્ગીકરણમાં એવા શબ્દો હોય છે જેનો ઉપયોગ તમે વસ્તુઓને વર્ગીકૃત કરવા માટે કરો છો. દાખલા તરીકે: "કલા" નામના વર્ગીકરણમાં બહુવિધ શબ્દો હોઈ શકે છે, જેમ કે "આધુનિક" અને "18મી સદી." જ્યારે વધુ ચોક્કસ ટેમ્પલેટ (દા.ત. ટેક્સોનોમી: આર્ટ) શોધી શકાતું નથી ત્યારે આ ટેમ્પલેટ ફોલબેક તરીકે કામ કરશે.','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>'એક લેખકનું પોસ્ટ આર્કાઇવ દર્શાવે છે. જ્યારે વધુ ચોક્કસ નમૂનો (દા.ત., લેખક: એડમિન) શોધી શકાતો નથી ત્યારે આ નમૂનો ફોલબેક તરીકે સેવા આપશે.','Displays a single post on your website unless a custom template has been applied to that post or a dedicated template exists.'=>'તમારી વેબસાઇટ પર એક પોસ્ટ પ્રદર્શિત કરે છે સિવાય કે તે પોસ્ટ પર કસ્ટમ નમૂનો લાગુ કરવામાં આવ્યો હોય અથવા સમર્પિત નમૂનો અસ્તિત્વમાં ન હોય.','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>'એક લેખક, શ્રેણી, ટેગ, વર્ગીકરણ, કસ્ટમ પોસ્ટ પ્રકાર અને તારીખ દ્વારા પોસ્ટ સહિત કોઈપણ આર્કાઇવ પ્રદર્શિત કરે છે. જ્યારે વધુ ચોક્કસ નમૂનાઓ (દા.ત., કેટેગરી અથવા ટેગ) શોધી શકાતા નથી ત્યારે આ ટેમ્પલેટ ફોલબેક તરીકે સેવા આપશે.','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>'પોસ્ટ કેટેગરી આર્કાઇવ દર્શાવે છે. જ્યારે વધુ ચોક્કસ ટેમ્પ્લેટ (દા.ત., કેટેગરી: વાનગીઓ) શોધી શકાતો નથી ત્યારે આ ટેમ્પ્લેટ ફોલબેક તરીકે સેવા આપશે.','Displays a static page unless a custom template has been applied to that page or a dedicated template exists.'=>'સ્થિર પેજને પ્રદર્શિત કરો સિવાય કે કસ્ટમ ટેમ્પ્લેટ લાગુ કરવામાં આવે છે અથવા સમર્પિત ટેમ્પ્લેટ અસ્તિત્વમાં ન હોય.','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g. Single Post, Page, or Attachment) cannot be found.'=>'કોઈપણ એક એન્ટ્રી દર્શાવે છે, જેમ કે પોસ્ટ અથવા પૃષ્ઠ. જ્યારે વધુ ચોક્કસ નમૂનો (દા.ત., એક પોસ્ટ, પૃષ્ઠ અથવા જોડાણ) શોધી શકાતો નથી ત્યારે આ નમૂનો ફોલબેક તરીકે સેવા આપશે.','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'તમારી સાઇટનું ફ્રન્ટ પેજ પ્રદર્શિત કરે છે, પછી ભલે તે નવીનતમ પોસ્ટ્સ અથવા સ્થિર પૃષ્ઠ પ્રદર્શિત કરવા માટે સેટ હોય. ફ્રન્ટ પેજ ટેમ્પ્લેટ તમામ નમૂનાઓ પર અગ્રતા ધરાવે છે.','Displays the latest posts as either the site homepage or as the "Posts page" as defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the homepage.'=>'નવીનતમ પોસ્ટ્સને સાઇટ હોમપેજ અથવા વાંચન સેટિંગ્સ હેઠળ વ્યાખ્યાયિત કસ્ટમ પૃષ્ઠ તરીકે પ્રદર્શિત કરે છે. જો તે અસ્તિત્વમાં છે, તો આગળના પૃષ્ઠ પર પોસ્ટ્સ બતાવવામાં આવે ત્યારે ફ્રન્ટ પેજ ટેમ્પલેટ આ નમૂનાને ઓવરરાઇડ કરે છે.','Used as a fallback template for all pages when a more specific template is not defined.'=>'જ્યારે વધુ ચોક્કસ નમૂનો વ્યાખ્યાયિત ન હોય ત્યારે તમામ પૃષ્ઠો માટે ફોલબેક નમૂના તરીકે ઉપયોગ થાય છે.','Block pattern categoryAbout'=>'વિશે','Block pattern categoryTeam'=>'ટીમ','Block pattern categoryPosts'=>'પોસ્ટ્સ','Block pattern categoryBanners'=>'બેનર્સ','block keywordpage'=>'પેજ','block descriptionThe author name.'=>'લેખકનું નામ.','block titlePage List Item'=>'પેજ સૂચિની વસ્તુ','block descriptionDisplays a page inside a list of all pages.'=>'બધા પેજની સૂચિની અંદર એક પેજ દર્શાવે છે.','block titleAuthor Name'=>'લેખકનું નામ','Style Variations'=>'શૈલી ભિન્નતા','Position'=>'પદ','Sticky'=>'સ્ટીકી','Warning: %1$s expects parameter %2$s (%3$s) to be a %4$s, %5$s given.'=>'ચેતવણી: %1$s %2$s (%3$s) %4$s, %5$s આપેલ હોવાની અપેક્ષા રાખે છે.','Too many bookmarks: cannot create any more.'=>'ઘણા બધા બુકમાર્ક્સ: વધુ બનાવી શકતા નથી.','Unknown bookmark name.'=>'અજાણ્યું બુકમાર્ક નામ.','Too many calls to seek() - this can lead to performance issues.'=>'સીક () કરવા માટે ઘણા બધા કૉલ્સ - આ કામગીરીની સમસ્યાઓ તરફ દોરી શકે છે.','Invalid attribute name.'=>'અમાન્ય એટ્રિબ્યુટ નામ.','The query argument must be an array or a tag name.'=>'ક્વેરી દલીલ એરે અથવા ટેગ નામ હોવી આવશ્યક છે.','When using the %1$s constant, make sure to set these globals to an array: %2$s.'=>'%1$s સ્થિરાંકનો ઉપયોગ કરતી વખતે, આ વૈશ્વિકોને એરેમાં સેટ કરવાનું સુનિશ્ચિત કરો: %2$s.','Please check that the %s PHP extension is installed and enabled.'=>'કૃપા કરીને તપાસો કે %s PHP એક્સ્ટેંશન ઇન્સ્ટોલ અને સક્ષમ છે.','Download file'=>'ફાઇલ ડાઉનલોડ કરો','The category description, in human readable format.'=>'માનવ વાંચી શકાય તેવા ફોર્મેટમાં કેટેગરીનું વર્ણન.','An array of template types where the pattern fits.'=>'નમૂના પ્રકારોની શ્રેણી જ્યાં પેટર્ન બંધબેસતી હોય.','https://wordpress.org/documentation/article/site-editor/'=>'https://wordpress.org/documentation/article/site-editor/','https://wordpress.org/documentation/article/reset-your-password/'=>'https://wordpress.org/documentation/article/reset-your-password/','Array of column names to be searched.'=>'શોધવા માટે કૉલમ નામોની એરે.','The block types which can use this pattern.'=>'બ્લોક પ્રકારો જે આ પેટર્નનો ઉપયોગ કરી શકે છે.','Arguments cannot be prepared as both an Identifier and Value. Found the following conflicts: %s'=>'દલીલો ઓળખકર્તા અને મૂલ્ય બંને તરીકે તૈયાર કરી શકાતી નથી. નીચેના વિરોધાભાસો મળ્યા: %s','Sorry, replies to unapproved comments are not allowed.'=>'માફ કરશો, અસ્વીકૃત ટિપ્પણીઓના જવાબોને મંજૂરી નથી.','https://wordpress.org/documentation/article/manage-wordpress-widgets/'=>'https://wordpress.org/documentation/article/manage-wordpress-widgets/','The image already has the requested size.'=>'છબી પહેલાથી જ વિનંતી કરેલ કદ ધરાવે છે.','Values for the input array must be either objects or arrays.'=>'ઇનપુટ એરે માટેના મૂલ્યો કાં તો ઑબ્જેક્ટ અથવા એરે હોવા જોઈએ.','Block pattern categoryServices'=>'સેવાઓ','Share reviews and feedback about your brand/business.'=>'તમારી બ્રાન્ડ/વ્યવસાય વિશે સમીક્ષાઓ અને પ્રતિસાદ શેર કરો.','Block pattern categoryTestimonials'=>'પ્રશંસાપત્રો','A variety of designs to display your team members.'=>'તમારી ટીમના સભ્યોને પ્રદર્શિત કરવા માટે વિવિધ ડિઝાઇન.','Sections whose purpose is to trigger a specific action.'=>'વિભાગો જેનો હેતુ ચોક્કસ ક્રિયાને ટ્રિગર કરવાનો છે.','https://wordpress.org/documentation/'=>'https://wordpress.org/documentation/','Patterns that contain buttons and call to actions.'=>'પેટર્ન જેમાં બટનો અને કૉલ ટુ એક્શન હોય છે.','Multi-column patterns with more complex layouts.'=>'વધુ જટિલ લેઆઉટ સાથે મલ્ટિ-કૉલમ પેટર્ન.','Patterns containing mostly text.'=>'મોટે ભાગે ટેક્સ્ટ ધરાવતી પેટર્ન.','Display your latest posts in lists, grids or other layouts.'=>'તમારી નવીનતમ પોસ્ટ્સને સૂચિ, ગ્રીડ અથવા અન્ય લેઆઉટમાં પ્રદર્શિત કરો.','A set of high quality curated patterns.'=>'ઉચ્ચ ગુણવત્તાની ક્યુરેટેડ પેટર્નનો સમૂહ.','Briefly describe what your business does and how you can help.'=>'તમારો વ્યવસાય શું કરે છે અને તમે કેવી રીતે મદદ કરી શકો છો તેનું સંક્ષિપ્તમાં વર્ણન કરો.','Block pattern categoryContact'=>'સંપર્ક','Display your contact information.'=>'તમારી સંપર્ક માહિતી દર્શાવો.','Introduce yourself.'=>'તમારા વિષે માહિતી આપો.','Block pattern categoryPortfolio'=>'પોર્ટફોલિયો','Showcase your latest work.'=>'તમારું નવીનતમ કાર્ય દર્શાવો.','Different layouts containing video or audio.'=>'વિડિયો અથવા ઑડિયો ધરાવતાં વિવિધ લેઆઉટ.','A variety of footer designs displaying information and site navigation.'=>'માહિતી અને સાઇટ નેવિગેશન પ્રદર્શિત કરતી વિવિધ ફૂટર ડિઝાઇન.','A variety of header designs displaying your site title and navigation.'=>'તમારી સાઇટ શીર્ષક અને નેવિગેશન દર્શાવતી વિવિધ હેડર ડિઝાઇન.','Untitled post %d'=>'શીર્ષક વિનાની પોસ્ટ %d','untitled post %s'=>'શીર્ષક વિનાની પોસ્ટ %s',': %s'=>': %s','There&#8217;s no content to show here yet.'=>'અહીં બતાવવા માટે હજી સુધી કોઈ સામગ્રી નથી.','Different layouts for displaying images.'=>'છબીઓ પ્રદર્શિત કરવા માટે વિવિધ લેઆઉટ.','User queries should not be run before the %s hook.'=>'વપરાશકર્તા ક્વેરીઝ %s હૂક પહેલાં ચલાવવી જોઈએ નહીં.','The %s argument must be a string or a string array.'=>'%s દલીલ સ્ટ્રિંગ અથવા સ્ટ્રિંગ એરે હોવી જોઈએ.','Sorry, you are not allowed to view terms for this post.'=>'માફ કરશો, તમને આ પોસ્ટ માટેની શરતો જોવાની મંજૂરી નથી.','Raw size value must be a string, integer, or float.'=>'કાચું કદ મૂલ્ય સ્ટ્રિંગ, પૂર્ણાંક અથવા ફ્લોટ હોવું આવશ્યક છે.','block titleComments'=>'ટિપ્પણીઓ','block titleComments Previous Page'=>'ટિપ્પણીઓ પહેલાનું પેજ','block titleComments Page Numbers'=>'ટિપ્પણીઓ પેજ નંબરો','block titleComments Next Page'=>'ટિપ્પણીઓ આગામી પેજ','Single item: %s'=>'સિંગલ વસ્તુ: %s','Default template'=>'ડિફૉલ્ટ નમૂનો','Edit template'=>'નમૂના સંપાદિત કરો','%s comment'=>'%s ટિપ્પણી' . "\0" . '%s ટિપ્પણીઓ','Site Domain (subdomain only):'=>'સાઇટ ડોમેન (ફક્ત સબડોમેન):','Site Name (subdirectory only):'=>'સાઇટનું નામ (ફક્ત સબડિરેક્ટરી):','Create a site or only a username:'=>'એક સાઇટ અથવા ફક્ત વપરાશકર્તાનામ બનાવો:','The date and time the preferences were updated.'=>'તારીખ અને સમય પસંદગીઓ અપડેટ કરવામાં આવી હતી.','There doesn\'t seem to be a %s file. It is needed before the installation can continue.'=>'%s ફાઇલ હોય તેવું લાગતું નથી. ઇન્સ્ટોલેશન ચાલુ રહે તે પહેલાં તે જરૂરી છે.','Revisions not enabled.'=>'પુનરાવર્તનો સક્ષમ નથી.','The icon for the post type.'=>'પોસ્ટ પ્રકાર માટે આયકન.','Whether the theme disables generated layout styles.'=>'શું થીમ જનરેટ કરેલ લેઆઉટ શૈલીઓને અક્ષમ કરે છે.','Whether a theme uses block-based template parts.'=>'શું થીમ બ્લોક-આધારિત નમૂના ભાગોનો ઉપયોગ કરે છે.','The template prefix for the created template. This is used to extract the main template type, e.g. in `taxonomy-books` extracts the `taxonomy`'=>'બનાવેલ નમૂના માટે ટેમ્પલેટ ઉપસર્ગ. આનો ઉપયોગ મુખ્ય નમૂનાના પ્રકારને કાઢવા માટે થાય છે, દા.ત. `વર્ગીકરણ-પુસ્તકો` માં `વર્ગીકરણ`નો અર્ક આપે છે','Indicates if a template is custom or part of the template hierarchy'=>'જો ટેમ્પલેટ કસ્ટમ છે અથવા ટેમ્પ્લેટ વંશવેલોનો ભાગ છે તે સૂચવે છે','The slug of the template to get the fallback for'=>'ફોલબેક મેળવવા માટે ટેમ્પલેટનો ગોકળગાય','If the value is a string, the value will be used as the archive slug. If the value is false the post type has no archive.'=>'જો મૂલ્ય સ્ટ્રિંગ છે, તો મૂલ્યનો ઉપયોગ આર્કાઇવ સ્લગ તરીકે કરવામાં આવશે. જો મૂલ્ય ખોટું હોય તો પોસ્ટ પ્રકાર પાસે કોઈ આર્કાઇવ નથી.','Public facing and editor style handle. DEPRECATED: Use `style_handles` instead.'=>'સાર્વજનિક સામનો અને સંપાદક શૈલી હેન્ડલ. અપ્રચલિત: તેના બદલે `શૈલી_હેન્ડલ્સ\' નો ઉપયોગ કરો.','Editor style handle. DEPRECATED: Use `editor_style_handles` instead.'=>'સંપાદક શૈલી હેન્ડલ. અમાન્ય: તેના બદલે `editor_style_handles` નો ઉપયોગ કરો.','Public facing script handle. DEPRECATED: Use `view_script_handles` instead.'=>'પબ્લિક ફેસિંગ સ્ક્રિપ્ટ હેન્ડલ. અપ્રચલિત: તેના બદલે `view_script_handles` નો ઉપયોગ કરો.','$store must be an instance of WP_Style_Engine_CSS_Rules_Store'=>'$store એ WP_Style_Engine_CSS_Rules_Store નું ઉદાહરણ હોવું જોઈએ','Editor script handle. DEPRECATED: Use `editor_script_handles` instead.'=>'સંપાદક સ્ક્રિપ્ટ હેન્ડલ. અમાન્ય: તેના બદલે `editor_script_handles` નો ઉપયોગ કરો.','Public facing and editor script handle. DEPRECATED: Use `script_handles` instead.'=>'પબ્લિક ફેસિંગ અને એડિટર સ્ક્રિપ્ટ હેન્ડલ. નાપસંદ: તેના બદલે `script_handles` નો ઉપયોગ કરો.','An array of post types that the pattern is restricted to be used with.'=>'પોસ્ટ પ્રકારોની શ્રેણી કે જેની સાથે પેટર્નનો ઉપયોગ કરવા માટે પ્રતિબંધિત છે.','REST API %1$s should be an array of arrays. Non-array value detected for %2$s.'=>'રેસ્ટ એપીઆઈ %1$s એ એરેની શ્રેણી હોવી જોઈએ. %2$s માટે બિન-એરે મૂલ્ય મળ્યું.','If you are the owner of this network please check that your host&#8217;s database server is running properly and all tables are error free.'=>'જો તમે આ નેટવર્કના માલિક છો તો કૃપા કરીને ચકાસો કે તમારા હોસ્ટનું ડેટાબેઝ સર્વર યોગ્ય રીતે ચાલી રહ્યું છે અ