ersion %2$s! Use %3$s instead.'=>'આવૃત્તિ %2$s થી ફાઇલ %1$s <strong>અમાન્ય</strong> છે! તેની જગ્યા એ %3$s ઉપયોગ કરો.','Function %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'આવૃત્તિ %2$s થી ફંકશન %1$s કોઈ વિકલ્પ ઉપલબ્ધ ન હોવાના લીધે <strong>અમાન્ય</strong> છે.','Function %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'વર્ઝન %2$s થી ફંક્શન %1$s <strong>નાપસંદ કરેલ</strong> છે! તેના બદલે %3$s નો ઉપયોગ કરો.','block titleRead More'=>'વધુ વાંચો','block descriptionDisplays the link of a post, page, or any other content-type.'=>'પોસ્ટ, પૃષ્ઠ અથવા કોઈપણ અન્ય સામગ્રી-પ્રકારની લિંક પ્રદર્શિત કરે છે.','block descriptionContains the block elements used to render content when no query results are found.'=>'જ્યારે કોઈ ક્વેરી પરિણામો મળ્યાં નથી ત્યારે સામગ્રીને રેન્ડર કરવા માટે ઉપયોગમાં લેવાતા બ્લોક ઘટકો ધરાવે છે.','block descriptionThe author biography.'=>'લેખકનું જીવનચરિત્ર.','block descriptionDisplay post author details such as name, avatar, and bio.'=>'નામ, અવતાર અને બાયો જેવી પોસ્ટ લેખકની વિગતો દર્શાવો.','block descriptionCreate a link that always points to the homepage of the site. Usually not necessary if there is already a site title link present in the header.'=>'એક લિંક બનાવો જે હંમેશા સાઇટના હોમપેજ પર નિર્દેશ કરે છે. જો હેડરમાં પહેલેથી જ સાઇટ શીર્ષકની લિંક હાજર હોય તો સામાન્ય રીતે જરૂરી નથી.','block titleAuthor Biography'=>'લેખક જીવનચરિત્ર','block titleHome Link'=>'હોમ લિંક','block titleComments Title'=>'ટિપ્પણીઓ શીર્ષક','block descriptionGather blocks in a layout container.'=>'લેઆઉટ કન્ટેનરમાં બ્લોક્સ ભેગા કરો','block descriptionAn advanced block that allows displaying post comments using different visual configurations.'=>'એક અદ્યતન બ્લોક જે વિવિધ વિઝ્યુઅલ રૂપરેખાંકનોનો ઉપયોગ કરીને પોસ્ટ ટિપ્પણીઓ પ્રદર્શિત કરવાની મંજૂરી આપે છે.','block descriptionDisplays a title with the number of comments.'=>'શીર્ષકની સાથે ટિપ્પણીઓની સંખ્યા દર્શાવે છે','block descriptionDisplays a paginated navigation to next/previous set of comments, when applicable.'=>'જયારે લાગુ પડે તીયારે ટિપ્પણીઓના જૂથ ને આગલા/પાછલા ના પૃષ્ઠ ક્રમાંકિત નેવિગેશન દર્શાવે છે.','block titleComments Pagination'=>'ટિપ્પણીઓનું પૃષ્ઠ ક્રમાંકન','block descriptionDisplays the previous comment\'s page link.'=>'અગાઉની ટિપ્પણીની ના પાના ની લિંક દર્શાવે છે.','block descriptionDisplays a link to reply to a comment.'=>'ટિપ્પણીનો જવાબ આપવા માટે એક લિંક પ્રદર્શિત કરે છે.','block descriptionDisplays a list of page numbers for comments pagination.'=>'ટિપ્પણીઓના પૃષ્ઠ ક્રમાંકન માટે પાના ના નંબરોની યાદી દર્શાવે છે.','block titleComment Template'=>'ટિપ્પણી ટેમ્પલેટ','block descriptionDisplays the next comment\'s page link.'=>'આગલી ટિપ્પણીની પૃષ્ઠ લિંક દર્શાવે છે.','block descriptionContains the block elements used to display a comment, like the title, date, author, avatar and more.'=>'શીર્ષક, તારીખ, લેખક, અવતાર અને વધુ જેવી ટિપ્પણી પ્રદર્શિત કરવા માટે ઉપયોગમાં લેવાતા બ્લોક ઘટકો સમાવે છે.','block titleComment Reply Link'=>'ટિપ્પણી જવાબ લિંક','block descriptionDisplays a link to edit the comment in the WordPress Dashboard. This link is only visible to users with the edit comment capability.'=>'વર્ડપ્રેસ ડેશબોર્ડમાં ટિપ્પણીને સંપાદિત કરવા માટે એક લિંક દર્શાવે છે. આ લિંક ફક્ત ટિપ્પણીમાં ફેરફાર કરવાની ક્ષમતા ધરાવતા વપરાશકર્તાઓને જ જોઈ શકાય છે.','block titleComment Edit Link'=>'ટિપ્પણી સંપાદિત લિંક','block descriptionDisplays the date on which the comment was posted.'=>'તેવી તારીખ દર્શાવે છે કે જેના પર ટિપ્પણી પોસ્ટ કરવામાં આવી હતી.','block descriptionDisplays the contents of a comment.'=>'ટિપ્પણીની સામગ્રી પ્રદર્શિત કરો.','block titleComment Author Name'=>'ટિપ્પણી લેખકનું નામ','block descriptionDisplays the name of the author of the comment.'=>'ટિપ્પણીના લેખકનું નામ દર્શાવે છે.','block titleAvatar'=>'અવતાર','block descriptionAdd a user’s avatar.'=>'વપરાશકર્તાનો અવતાર ઉમેરો.','A WordPress Commenter'=>'વર્ડપ્રેસ ટિપ્પણીકર્તા','Responses to %s'=>'%s ને પ્રતિભાવો','Response to %s'=>'%s ને પ્રતિસાદ','block