 નથી; જો કે, કેટલીક થીમ્સ તે બતાવી શકે છે.','Assign a parent term to create a hierarchy. The term Jazz, for example, would be the parent of Bebop and Big Band.'=>'વંશવેલો બનાવવા માટે પિતૃ શબ્દ સોંપો. જાઝ શબ્દ, ઉદાહરણ તરીકે, બેબોપ અને બિગ બેન્ડના પિતૃ હશે.','The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'આ &#8220;સ્લગ&#8221; નામનું URL-ફ્રેંડલી વર્ઝન છે. તે સામાન્ય રીતે તમામ લોઅરકેસ હોય છે અને તેમાં માત્ર અક્ષરો, સંખ્યાઓ અને હાઇફન્સ હોય છે.','The name is how it appears on your site.'=>'નામ એ છે કે તે તમારી સાઇટ પર કેવી રીતે દેખાય છે.','Template Part Area'=>'ટેમ્પલેટ ભાગ વિસ્તાર','Template Part Areas'=>'ટેમ્પલેટ ભાગ વિસ્તારો','The server cannot process the image. This can happen if the server is busy or does not have enough resources to complete the task. Uploading a smaller image may help. Suggested maximum size is 2560 pixels.'=>'સર્વર ઇમેજ પર પ્રક્રિયા કરી શકતું નથી. જો સર્વર વ્યસ્ત હોય અથવા કાર્ય પૂર્ણ કરવા માટે પૂરતા સંસાધનો ન હોય તો આવું થઈ શકે છે. નાની છબી અપલોડ કરવાથી મદદ મળી શકે છે. સૂચિત મહત્તમ કદ 2560 પિક્સેલ છે.','Limit result set to users who have published posts.'=>'પરિણામની મર્યાદા એવા વપરાશકર્તાઓ માટે સેટ કરો કે જેમણે પોસ્ટ્સ પ્રકાશિત કરી છે.','Limit result set to users matching at least one specific capability provided. Accepts csv list or single capability.'=>'પૂરી પાડવામાં આવેલ ઓછામાં ઓછી એક ચોક્કસ ક્ષમતા સાથે મેળ ખાતા વપરાશકર્તાઓ માટે મર્યાદા પરિણામ સેટ કરો. csv સૂચિ અથવા સિંગલ ક્ષમતા સ્વીકારે છે.','Invalid URL'=>'અમાન્ય URL','Sorry, you are not allowed to process remote URLs.'=>'માફ કરશો, તમને રિમોટ url પર પ્રક્રિયા કરવાની મંજૂરી નથી.','Sorry, you are not allowed to filter users by capability.'=>'માફ કરશો, તમને ક્ષમતા દ્વારા વપરાશકર્તાઓને ફિલ્ટર કરવાની મંજૂરી નથી.','The contents of the %s element from the URL.'=>'યુઆરએલ માંથી %s ઘટકની સામગ્રી.','The favicon image link of the %s element from the URL.'=>'યુઆરએલ માંથી %s તત્વની ફેવિકોન ઇમેજ લિંક.','Unable to retrieve body from response at this URL.'=>'આ યુઆરએલ પર પ્રતિસાદમાંથી શરીર પુનઃપ્રાપ્ત કરવામાં અસમર્થ.','URL not found. Response returned a non-200 status code for this URL.'=>'યુઆરએલ મળ્યું નથી. પ્રતિભાવે આ યુઆરએલ માટે નો-200 સ્ટેટસ કોડ પરત કર્યો.','The content of the %s element from the URL.'=>'યુઆરએલ માંથી %s ઘટકની સામગ્રી.','The Open Graph image link of the %1$s or %2$s element from the URL.'=>'યુઆરએલ  માંથી %1$s અથવા %2$s ઘટકની ઓપન ગ્રાફ ઇમેજ લિંક.','The URL to process.'=>'પ્રક્રિયા કરવા માટેનું URL(યુઆરએલ).','Whether to make the post type available for selection in navigation menus.'=>'શું પોસ્ટ પ્રકાર બનાવવો તે નેવિગેશન મેનુમાં પસંદગી માટે ઉપલબ્ધ છે.','Version of the content block format used by the template.'=>'ટેમ્પલેટ દ્વારા ઉપયોગમાં લેવાતા સામગ્રી બ્લોક ફોર્મેટનું સંસ્કરણ.','Title for the template, as it exists in the database.'=>'ટેમ્પલેટ માટે શીર્ષક, કારણ કે તે ડેટાબેઝમાં અસ્તિત્વ ધરાવે છે.','Content for the template, as it exists in the database.'=>'ટેમ્પલેટ માટેની સામગ્રી, કારણ કે તે ડેટાબેઝમાં અસ્તિત્વમાં છે.','Type of template.'=>'ટેમ્પલેટ ના પ્રકાર.','Where the template part is intended for use (header, footer, etc.)'=>'જ્યાં ટેમ્પલેટ નો ભાગ ઉપયોગ માટે બનાવાયેલ છે (હેડર, ફૂટર, વગેરે)','Whether a template is a custom template.'=>'શું ટેમ્પલેટ કસ્ટમ  ટેમ્પલેટ છે.','REST namespace route for the taxonomy.'=>'ટેક્સનોમી માટે REST નેમસ્પેસ માર્ગ.','Source of a customized template'=>'કસ્ટમાઇઝ કરેલ ટેમ્પલેટનો સ્ત્રોત','The ID for the author of the template.'=>'ટેમ્પલેટના લેખકનું ID.','Limit to the specified template part area.'=>'ઉલ્લેખિત ટેમ્પલેટ ભાગના વિસ્તાર સુધી મર્યાદિત કરો.','Post type to get the templates for.'=>'ટેમ્પલેટઓને મેળવવા માટે ના પોસ્ટ પ્રકાર.','HTML title for the template, transformed for display.'=>'ટેમ્પલેટ માટે HTML શીર્ષક, પ્રદર્શન માટે રૂપાંતરિત.','The terms assigned to the object in the %s taxonomy.'=>'%s વર્ગીકરણમાં ઑબ્જેક્ટને સોંપેલ શરતો.','An alphanumeric identifier for the menu location.'=>'મેનુ સ્થાન માટે આલ્ફાન્યૂમેરિક ઓળખકર્તા.','Invalid menu location.'=>'અમાન્ય મેનૂ સ્થાન.','Sorry, you are not allowed to view menu locations.'=>'માફ કરશો, તમને મેનૂ સ્થાનો જોવાની મંજૂરી નથી.','The name of the menu location.'=>'મેનુ સ્થાનનું નામ.','The ID of the assigned menu.'=>'સોંપેલ મેનૂનું ID.','The description of the menu location.'=>'મેનુ સ્થાનનું વર્ણન.','Sorry, you are not allowed to view menus.'=>'માફ કરશો, તમને મેનુ જોવાની મંજૂરી નથી.','The menu cannot be deleted.'=>'મેનુ કાઢી શકાતું નથી.','Whether to automatically add top level pages to this menu.'=>'આ મેનુમાં ટોચના સ્તરના પૃષ્ઠોને આપમેળે ઉમેરવું કે કેમ.','REST route\'s namespace for the post type.'=>'પોસ્ટ પ્રકાર માટે REST રૂટનું નેમસ્પેસ.','The visibility settings for the post type.'=>'પોસ્ટ પ્રકાર માટે દૃશ્યતા સેટિંગ્સ.','Whether to generate a default UI for managing this post type.'=>'આ પોસ્ટ પ્રકારનું સંચાલન કરવા માટે ડિફોલ્ટ UI જનરેટ કરવું કે કેમ.','The locations assigned to the menu.'=>'મેનુને સોંપેલ સ્થાનો.','Menus do not support trashing. Set \'%s\' to delete.'=>'મેનુઓ ટ્રૅશ માટે આધાર આપતા નથી. કાઢી નાખવા માટે \'%s\' સેટ કરો.','The type of object originally represented, such as "category", "post", or "attachment".'=>'ઑબ્જેક્ટનો પ્રકાર જે મૂળ રીતે રજૂ થાય છે, જેમ કે "શ્રેણી", "પોસ્ટ" અથવા "જોડાણ".','The database ID of the original object this menu item represents, for example the ID for posts or the term_id for categories.'=>'મૂળ ઑબ્જેક્ટનો ડેટાબેઝ ID જે આ મેનૂ આઇટમ રજૂ કરે છે, ઉદાહરણ તરીકે પોસ્ટ્સ માટે ID અથવા શ્રેણીઓ માટે term_id.','The target attribute of the link element for this menu item.'=>'આ મેનૂ આઇટમ માટે લિંક ઘટકનું લક્ષ્ય લક્ષણ.','The singular label used to describe this type of menu item.'=>'આ પ્રકારની મેનૂ આઇટમનું વર્ણન કરવા માટે વપરાતું એકવચન લેબલ.','The URL to which this menu item points.'=>'આ મેનૂ આઇટમ જે URL પર નિર્દેશ કરે છે.','The XFN relationship expressed in the link of this menu item.'=>'આ મેનૂ આઇટમની લિંકમાં દર્શાવવામાં આવેલ XFN સંબંધ.','Whether the menu item represents an object that no longer exists.'=>'શું 