Name: %3$s','%s failed while writing image to stream.'=>'%s સ્ટ્રીમ પર ચિત્ર લખતી વખતે નિષ્ફળ થયું.','The provided password is an invalid application password.'=>'પ્રદાન કરેલો પાસવર્ડ અમાન્ય એપ્લિકેશન પાસવર્ડ છે.','Copy URL to clipboard'=>'ક્લિપબોર્ડ પર URL ને કોપી કરો','Could not delete application passwords.'=>'એપ્લિકેશન પાસવર્ડ્સ કાઢી શકાતા નથી.','Could not delete application password.'=>'એપ્લિકેશન પાસવર્ડ કાઢી શકાતા નથી.','Could not find an application password with that id.'=>'તે id સાથે એપ્લિકેશન પાસવર્ડ શોધી શક્યા નથી.','Could not save application password.'=>'એપ્લિકેશન પાસવર્ડ સાચવણી શકાયો નથી.','An application name is required to create an application password.'=>'અરજી પાસવર્ડ બનાવવા માટે અરજી નુ નામ જરૂરી છે.','Used as:'=>'તરીકે વપરાય છે:','%1$s is not a valid %2$l.'=>'%1$s એ માન્ય %2$l નથી.','%1$s is not a valid %2$s. Reason: %3$s'=>'%1$s એ માન્ય %2$s નથી. કારણ: %3$s','%1$s must be a multiple of %2$s.'=>'%1$s એ %2$s નો ગુણાંક હોવો જોઈએ.','%1$s must contain at most %2$s property.'=>'%1$s માં વધુમાં વધુ %2$s મિલકત હોવી આવશ્યક છે.' . "\0" . '%1$s માં વધુમાં વધુ %2$s પ્રોપર્ટીઝ હોવી જોઈએ.','%1$s must contain at least %2$s property.'=>'%1$s માં ઓછામાં ઓછી %2$s મિલકત હોવી આવશ્યક છે.' . "\0" . '%1$s માં ઓછામાં ઓછી %2$s મિલકતો હોવી આવશ્યક છે.','%1$s does not match the expected format. Reason: %2$s'=>'%1$s અપેક્ષિત ફોર્મેટથી મેળ ખાતું નથી. કારણઃ %2$s','%s does not match any of the expected formats.'=>'%s કોઈપણ અપેક્ષિત ફોર્મેટ સાથે મેળ ખાતી નથી.','%1$s matches %2$l, but should match only one.'=>'%1$s %2$l સાથે મેળ ખાય છે, પરંતુ માત્ર એક સાથે મેળ ખાતો હોવો જોઈએ.','%s matches more than one of the expected formats.'=>'%s અપેક્ષિત ફોર્મેટમાંના એક કરતાં વધુ મેળ ખાય છે.','The name of the application password.'=>'એપ્લિકેશન પાસવર્ડનું નામ.','The GMT date the application password was created.'=>'GMT તારીખ એપ્લિકેશન પાસવર્ડ બનાવવામાં આવી હતી.','The generated password. Only available after adding an application.'=>'ઉત્પ્પન કરેલો પાસવર્ડ. એપ્લિકેશન ઉમેર્યા પછી જ ઉપલબ્ધ.','A UUID provided by the application to uniquely identify it. It is recommended to use an UUID v5 with the URL or DNS namespace.'=>'એપ્લિકેશન દ્વારા વિશિષ્ટ રૂપે ઓળખવા માટે આપવામાં આવેલ UUID. URL અથવા DNS નામ સાથે UUID v5 નો ઉપયોગ કરવાની ભલામણ કરવામાં આવે છે.','The GMT date the application password was last used.'=>'જીએમટી તારીખ એપ્લિકેશન પાસવર્ડ છેલ્લે ઉપયોગ થયો હતો.','The IP address the application password was last used by.'=>'IP સરનામું અને એપ્લિકેશન પાસવર્ડ છેલ્લે ઉપયોગમાં લેવાયો હતો.','Application passwords are not available.'=>'એપ્લિકેશન પાસવર્ડ્સ ઉપલબ્ધ નથી.','Sorry, you are not allowed to manage application passwords for this user.'=>'માફ કરશો, તમને આ વપરાશકર્તા માટે એપ્લિકેશન પાસવર્ડ્સ મેનેજ કરવાની મંજૂરી નથી.','The unique identifier for the application password.'=>'એપ્લિકેશન પાસવર્ડ માટે અનન્ય ઓળખકર્તા.','Application password not found.'=>'એપ્લિકેશન પાસવર્ડ મળ્યો નથી.','Application passwords are not available for your account. Please contact the site administrator for assistance.'=>'તમારા ખાતા માટે એપ્લિકેશન પાસવર્ડ્સ ઉપલબ્ધ નથી. કૃપા કરીને સહાય માટે સાઇટ સંચાલકનો સંપર્ક કરો.','HTML containing an action to direct the user to where they can resolve the issue.'=>'વપરાશકર્તાને જ્યાં તેઓ સમસ્યાનું નિરાકરણ લાવી શકે તે તરફ નિર્દેશિત કરવા માટેની ક્રિયા ધરાવતું HTML.','The name of the test being run.'=>'જે ટેસ્ટ ચાલી રહી છે તેનું નામ.','The status of the test.'=>'પરીક્ષણની સ્થિતિ.','A label describing the test.'=>'પરીક્ષણનું વર્ણન કરતું લેબલ.','Directory sizes could not be returned.'=>'ડિરેક્ટરી માપો પરત કરી શકાયા નથી.','The category this test is grouped in.'=>'આ કસોટી કેટેગરીમાં જૂથબદ્ધ છે.','A more descriptive explanation of what the test looks for, and why it is important for the user.'=>'ટેસ્ટ શા માટે જુએ છે અને તે વપરાશકર્તા માટે શા માટે મહત્વપૂર્ણ છે તેનું વધુ વર્ણનાત્મક સમજૂતી.','Invalid parameters.'=>'અમાન્ય પેરામીટર્સ.','The handler for the route is invalid.'=>'આ રાઉટ(route) નો હેન્ડલર અમાન્ય છે.','You need to pass an array of post formats.'=>'તમારે પોસ્ટ ફોર્મેટ્સ નો એરે આપવો જોઇએ.','Could not parse the path.'=>'પાથનું વિશ્લેષણ કરી શકાયું નથી.','Version of block API.'=>'બ્લોક એ પી આઈ ની આવૃત્તિ.','This password reset request originated from the IP address %s.'=>'આ પાસવર્ડ રીસેટ વિનંતિ IP એડ્રેસ %s થી ઉદ્ભવી છે.','The requested route does not support batch requests.'=>'વિનંતી કરેલ રૂટ બેચ વિનંતીઓને સપોર્ટ કરતું નથી.','Sorry, you are not allowed to comment on this post.'=>'માફ કરશો, તમને આ પોસ્ટ પર ટીપ્પણી કરવાની મંજૂરી નથી.','The %s constant is no longer supported.'=>'આ %s અચલ ને હવે સપોર્ટ નથી.','There is a new version of %s available, but it does not work with your version of WordPress.'=>'ત્યાં %s નું નવું આવૃત્તિ ઉપલબ્ધ છે, પરંતુ તે તમારા WordPress ના આવૃત્તિ સાથે કામ કરતું નથી','There is a new version of %s available, but it does not work with your versions of WordPress and PHP.'=>'%s નું નવું સંસ્કરણ ઉપલબ્ધ છે, પરંતુ તે તમારા વર્ડપ્રેસ અને પીએચપીના સંસ્કરણ સાથે કાર્ય કરતું નથી.','There is a new version of %s available, but it does not work with your version of PHP.'=>'%s નું નવું સંસ્કરણ ઉપલબ્ધ છે, પરંતુ તે તમારા PHP ના સંસ્કરણ સાથે કામ કરતું નથી.','<a href="%s">Please update WordPress</a>.'=>'<a href="%s">મહેરબાની કરીને વર્ડપ્રેસ અપડેટ કરો</a>.','<a href="%s">Learn more about updating PHP</a>.'=>'<a href="%s">PHP ને અપડેટ કરવા વિશે વધુ જાણો</a>.','This theme does not work with your version of WordPress.'=>'આ થીમ તમારા વર્ડપ્રેસના વર્જન સાથે કાર્ય કરશે નહીં.','This theme does not work with your versions of WordPress and PHP.'=>'આ થીમ WordPress અને PHP ના તમારા સંસ્કરણો સાથે કામ કરતી નથી.','<a href="%1$s">Please update WordPress</a>, and then <a href="%2$s">learn more about updating PHP</a>.'=>'<a href="%1$s">કૃપા કરીને WordPress અપડેટ કરો</a> અને પછી <a href="%2$s">PHP અપડેટ કરવા વિશે વધુ જાણો</a>.','This theme does not work with your version of PHP.'=>'આ થીમ તમારા PHP ના સંસ્કરણ સાથે કામ કરતી નથી.','The "%s" must be a callable function.'=>'"%s" એ કૉલેબલ ફંક્શન હોવું આવશ્યક છે.','Please use %s to add new schema properties.'=>'કૃપા કરીને નવી સ્કીમા ગુણધર્મો ઉમેરવા માટે %s નો ઉપયોગ કરો.','Unauthorized. You may remove the %s param to preview as frontend.'=>'અનધિકૃત. તમે ફ્રન્ટએન્ડ તરીકે પૂર્વાવલોકન કરવા માટે %s પરમ દૂર કરી શકો છો.','The "%1$s" option key has been renamed to "%2$s".'=>'"%1$s" વિકલ્પ કીનું નામ "%2$s" રાખવામાં આવ્યું છે.','Sorry, you are not allowed to manage network plugins.'=>'માફ કરશો, તમને નેટવર્ક પ્લગિન્સ મેનેજ કરવા માટે પરવાનગી નથી.','The REST API route definition for %1$s is missing the required %2$s argument. For REST API routes that are intended to be public, use %3$s as the permission callback.'=>'%1$s માટેની REST API રૂટ વ્યાખ્યામાં જરૂરી %2$s દલીલ ખૂટે છે. REST API રૂટ કે જે સાર્વજનિક બનવાના છે તે માટે, પરવાનગી કૉલબેક તરીકે %3$s નો ઉપયોગ કરો.','Sorry, you are not allowed to activate this plugin.'=>'માફ કરશો, તમને આ પ્લગઈન સક્રિય કરવાની મંજૂરી નથી.','Could not update attachment in the database.'=>'ડેટાબેઝમાં જોડાણને અપડેટ કરી શક્યાં નથી','by %s'=>'%s દ્વારા','An error occurred.'=>'એક ભૂલ આવી','Comment'=>'ટિપ્પણી','Menu Item'=>'મેનુ વસ્તુ','Crop'=>'કાપો ','Notifications'=>'સૂચનાઓ','The file URL has been copied to your clipboard'=>'ફાઇલ URL ને તમારા ક્લિપબોર્ડ પર નકલ કરવામાં આવી છે','Embed Handler'=>'એમ્બેડિંગ હેન્ડલર','Read the <a href="%s" target="_blank">Debugging a WordPress Network</a> article. Some of the suggestions there may help you figure out what went wrong.'=>'<a href="%s" target="_blank">bug report</a> પેજ વાંચો. આમાંથી થોડીક ગાઈડલાઈન્સ તમને શું ખોટું થઇ રહ્યું છે તે જાણવામાં મદદરૂપ થશે.','unit symbolB'=>'B','unit symbolKB'=>'KB','unit symbolMB'=>'MB','unit symbolGB'=>'GB','unit symbolTB'=>'TB','Block pattern categoryButtons'=>'બટનો','Block pattern categoryHeaders'=>'હેડર','Block pattern categoryGallery'=>'ગેલેરી','Block pattern categoryColumns'=>'કોલમ','Block pattern categoryText'=>'લખાણ','Block pattern category "%s" not found.'=>'બ્લોક પેટર્ન શ્રેણી "%s" મળી નથી.','Block pattern category name must be a string.'=>'બ્લોક પેટર્ન કેટે