ion number.'=>'પ્લગિન આવૃત્તિ ક્રમાંક.','Sorry, you are not allowed to deactivate this plugin.'=>'માફ કરશો, તમને પ્લગિન ને નિષ્ક્રિય કરવાની મંજૂરી નથી.','Unable to determine what plugin was installed.'=>'કયું પ્લગઇન ઇન્સ્ટોલ કર્યું હતું તે નક્કી કરવામાં અસમર્થ.','Sorry, you are not allowed to install plugins on this site.'=>'માફ કરશો, તમને આ સાઇટ પર પ્લગિન્સ સ્થાપિત કરવા માટે મંજૂરી નથી.','The plugin activation status.'=>'પ્લગઇન સક્રિયકરણ સ્થિતિ.','The plugin description.'=>'પ્લગઇન વર્ણન.','WordPress.org plugin directory slug.'=>'WordPress.org પ્લગઇન ડાયરેક્ટરી સ્લગ.','Unable to connect to the filesystem. Please confirm your credentials.'=>'ફાઇલસિસ્ટમ સાથે કનેક્ટ કરવામાં અક્ષમ. કૃપા કરીને તમારા ઓળખપત્રોની પુષ્ટિ કરો.','Cannot delete an active plugin. Please deactivate it first.'=>'સક્રિય પ્લગઇનને કાઢી શકતા નથી. મહેરબાની કરીને તેને પહેલા નિષ્ક્રિય કરો.','Network only plugin must be network activated.'=>'ફક્ત નેટવર્ક પ્લગઇન નેટવર્ક સક્રિય હોવું આવશ્યક છે.','The filesystem is currently unavailable for managing plugins.'=>'ફાઇલસિસ્ટમ હાલમાં પ્લગઇન્સ મેનેજ કરવા માટે અનુપલબ્ધ છે.','The raw plugin description.'=>'રો પ્લગઈન વર્ણન.','The plugin description formatted for display.'=>'ડિસ્પ્લે માટે પ્લગઇન વર્ણન ફોર્મેટ કરેલ છે.','Whether the plugin can only be activated network-wide.'=>'શું પ્લગઇન ફક્ત નેટવર્ક-વ્યાપી સક્રિય થઈ શકે છે.','A description of the theme.'=>'થીમનું વર્ણન.','The theme\'s current version.'=>'થીમનું વર્તમાન સંસ્કરણ.','The name of the theme.'=>'થીમનું નામ.','The website of the theme author.'=>'થીમ લેખકની વેબસાઇટ.','The theme author.'=>'થીમ લેખક.','The theme\'s text domain.'=>'થીમનું ટેક્સ્ટ ડોમેન.','The theme tags, transformed for display.'=>'થીમનો સ્ક્રીનશોટ યુઆરએલ.','The theme tags, as found in the theme header.'=>'થીમ ટૅગ્સ, જેમ કે થીમ હેડરમાં જોવા મળે છે.','HTML for the theme author, transformed for display.'=>'થીમ લેખક માટે એચટીએમએલ(HTML), પ્રદર્શન માટે રૂપાંતરિત.','The theme\'s template. If this is a child theme, this refers to the parent theme, otherwise this is the same as the theme\'s stylesheet.'=>'થીમનો ટેમ્પ્લેટ. જો આ બાળ થીમ છે, તો આ પેરેન્ટ થીમનો સંદર્ભ આપે છે, અન્યથા આ થીમની સ્ટાઈલશીટ જેવી જ છે.','The theme author\'s name, as found in the theme header.'=>'થીમના મથાળામાં જોવા મળે છે તેમ થીમ લેખકનું નામ.','The website of the theme author, as found in the theme header.'=>'થીમ હેડરમાં મળેલ થીમ લેખકની વેબસાઇટ.','The website of the theme author, transformed for display.'=>'થીમ લેખકની વેબસાઇટ, પ્રદર્શન માટે રૂપાંતરિત.','The theme description, as found in the theme header.'=>'થીમનું વર્ણન, થીમ હેડરમાં જોવા મળે છે.','The theme description, transformed for display.'=>'થીમ વર્ણન, પ્રદર્શન માટે રૂપાંતરિત.','The theme name, as found in the theme header.'=>'થીમનું નામ, થીમ હેડરમાં જોવા મળે છે.','The theme name, transformed for display.'=>'થીમનું નામ, ડિસ્પ્લે માટે રૂપાંતરિત.','The minimum PHP version required for the theme to work.'=>'થીમ કામ કરવા માટે જરૂરી ન્યૂનતમ PHP સંસ્કરણ.','The minimum WordPress version required for the theme to work.'=>'થીમ કામ કરવા માટે જરૂરી ન્યૂનતમ વર્ડપ્રેસ વર્ઝન.','The theme\'s screenshot URL.'=>'થીમની સ્ક્રીનશોટ URL.','Tags indicating styles and features of the theme.'=>'થીમની શૈલીઓ અને લક્ષણો દર્શાવતા ટૅગ્સ.','The URI of the theme\'s webpage.'=>'થીમના વેબપેજનો URI.','The URI of the theme\'s webpage, as found in the theme header.'=>'થીમ હેડરમાં જોવા મળે છે તેમ થીમના વેબપેજનો URI.','The URI of the theme\'s webpage, transformed for display.'=>'થીમના વેબપેજનો URI, પ્રદર્શન માટે રૂપાંતરિત.','Parent blocks.'=>'પેરેન્ટ બ્લોક','Block example.'=>'બ્લોક ઉદાહરણ.','The name of the inner block.'=>'પેટા બ્લોકનું નામ.','Block keywords.'=>'બ્લોક કીવર્ડ્સ.','Public text domain.'=>'સાર્વજનિક ટેક્સ્ટ ડોમેન.','Contains the handle that defines the block style.'=>'હેન્ડલ સમાવે છે જે બ્લોક શૈલીને વ્યાખ્યાયિત કરે છે.','Inline CSS code that registers the CSS class required for the style.'=>'ઇનલાઇન CSS કોડ કે જે શૈલી માટે જરૂરી CSS વર્ગની નોંધણી કરે છે.','The human-readable label for the style.'=>'શૈલી માટે મા