ુઓ પ્રદર્શિત કરી શકે છે.' . "\0" . 'તમારી થીમ %s સ્થાનોમાં મેનુઓ પ્રદર્શિત કરી શકે છે.','Your theme can display menus in one location.'=>'તમારી થીમ એક સ્થાનમાં મેનુઓ પ્રદર્શિત કરી શકે છે.','CSS code'=>'સીએસએસ (CSS) કોડ','When using a keyboard to navigate:'=>'નેવિગેટ કરવા માટે કીબોર્ડનો ઉપયોગ કરતી વખતે:','Add your own CSS code here to customize the appearance and layout of your site.'=>'તમારી સાઇટના દેખાવ અને લેઆઉટને કસ્ટમાઇઝ કરવા માટે તમારા પોતાના CSS કોડને અહીં ઉમેરો.','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'સંપાદન ક્ષેત્ર આપમેળે કોડ વાક્યરચનાને હાઇલાઇટ કરે છે. તમે સાદા ટેક્સ્ટ મોડમાં કાર્ય કરવા માટે તમારા <a href="%1$s" %2$s> વપરાશકર્તા પ્રોફાઇલ%3$s </a> માં આને અક્ષમ કરી શકો છો.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'સ્ક્રીન રીડર વપરાશકર્તાઓ: જ્યારે ફોર્મ મોડમાં હોવ, ત્યારે તમારે બે વખત એસ્કેપ (Esc) કી દબાવવાની જરૂર પડી શકે છે.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'જો તમારી થીમમાં વધારે મેનૂ હોય, તો તેમને સ્પષ્ટ નામો આપવાથી સંચાલિત કરવામાં તમને મદદ રહેશે.','Your homepage displays'=>'તમારું હોમપેજ બતાવે છે','In the editing area, the Tab key enters a tab character.'=>'સંપાદન વિસ્તારમાં, ટૅબ કી ટેબ અક્ષર દાખલ કરે છે.','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'તમે તમારી સાઇટના હોમપેજ પર શું પ્રદર્શિત થયુ છે તે પસંદ કરી શકો છો. તે વિપરીત સમયાનુક્રમિક ક્રમમાં પોસ્ટ (ક્લાસિક બ્લોગ), અથવા એક નિશ્ચિત/સ્થિર પેજ  હોઈ શકે છે. સ્થિર હોમપેજ સેટ કરવા માટે, તમારે પહેલા બે પેજ બનાવવાની જરૂર છે. એક હોમપેજ બનશે, અને અન્ય પેજ હશે જ્યાં તમારી પોસ્ટ પ્રદર્શિત થાય છે.','To move away from this area, press the Esc key followed by the Tab key.'=>'આ વિસ્તારમાંથી અન્ય જગ્યાએ જવા માટે, ટેબ(Tab) કી પછી એસ્કેપ(Esc) કી દબાવો.','Homepage Settings'=>'હોમપેજ સેટિંગ્સ','There was an authentication problem. Please reload and try again.'=>'પ્રમાણીકરણ કરવામાં સમસ્યા આવી હતી. કૃપા કરીને ફરીથી લોડ કરો અને ફરીથી પ્રયાસ કરો.','Unable to save due to %s invalid setting.'=>'%s અમાન્ય સેટિંગને કારણે સાચવવામાં અક્ષમ છે.' . "\0" . '%s અમાન્ય સેટિંગ્સને કારણે સાચવવામાં અક્ષમ છે.','You must supply a future date to schedule.'=>'તમારે સુનિશ્ચિત કરવા માટે ભવિષ્યની તારીખ આપવી આવશ્યક છે.','Publish Settings'=>'સેટિંગ્સ પ્રકાશિત કરો','Preview Link'=>'પૂર્વદર્શન લિંક','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'જુઓ કે કેવી રીતે ફેરફારો તમારી વેબસાઇટ પર લાઇવ દેખાશે, અને પૂર્વદર્શન શેર કરો, જે કસ્ટમાઈઝર ને ઍક્સેસ કરી શકતા નથી.','Share Preview Link'=>'પૂર્વદર્શન લિંક શેર કરો','Changes trashed successfully.'=>'ફેરફારો સફળતાપૂર્વક ટ્રેશ થઈ ગયા.','Unable to trash changes.'=>'ફેરફારોને ટ્રેશ કરવામાં અસમર્થ.','Changes have already been trashed.'=>'ફેરફારો પહેલેથી જ ટ્રેશ થઈ ગયા છે.','Installed themes'=>'સ્થાપિત કરેલી થીમ','WordPress.org themes'=>'WordPress.org થીમ','Copied'=>'કૉપિ થઇ ગયું','No changes saved yet, so there is nothing to trash.'=>'કોઈ ફેરફારો હજુ સુધી સચવાયા નથી, તેથી ટ્રૅશમાં કંઇ નથી.','View User'=>'વપરાશકર્તા ને જુઓં','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'ફેરફારોનું પહેલાંનું સેટ પહેલાથી જ પ્રકાશિત થયું છે. કૃપા કરીને ફરીથી તમારા વર્તમાન સેટ્સને સાચવવાનો પ્રયાસ કરો.','Edit User'=>'વપરાશકર્તા સંપાદિત કરો','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'આ વિજેટમાં કોડ શામેલ હોઈ શકે છે જે &#8220;કસ્ટમ HTML&#8221; વિજેટ જો તમારી પાસે હજી સુધી નથી, તો તેના બદલે તે વિજેટને અજમાવવા વિશે કેવી રીતે?','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'અરે, તમે સાંભળ્યું છે કે અમારી પાસે હવે &#8220;કસ્ટમ HTML&#8221; વિજેટ છે? તમે આ સ્ક્રીન પર ઉપલબ્ધ વિજેટ્સની સૂચિને સ્કેન કરીને શોધી શકો છો. તમારી સાઇટ પર કેટલાક કસ્ટમ કોડ ઉમેરવા માટે તેને તપાસો!','Did you just paste HTML?'=>'શું તમે હમણાં HTML પેસ્ટ કર્યું?','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'અરે, તમે સાંભળ્યું છે કે અમારી પાસે હવે &#8220;કસ્ટમ HTML&#8221; વિજેટ છે? તમે તેને &#8220;<a class="add-widget" href="#"> એક વિજેટ ઉમેરો </a>&#8221; દબાવીને શોધી શકો છો. તમારી સાઇટ પર કેટલાક કસ્ટમ કોડ ઉમેરવા માટે તેને તપાસો!','New Custom HTML Widget'=>'નવું  કસ્ટમ HTML વિજેટ','Arbitrary text.'=>'મનમાનીતુ લખાણ.','This widget may contain code that may work better in the &#8220;Custom HTML&#8221; widget. How about trying that widget instead?'=>'આ વિજેટમાં નવા &#8220;કસ્ટમ HTML&#8221; વિજેટમાં વધુ સારું કામ કરી શકે તેવો કોડ હોઈ શકે છે. તે વિજેટને અજમાવી શકો છો?','Custom HTML'=>'કસ્ટમ HTML','Some HTML tags are not permitted, including:'=>'કેટલાક HTML ટૅગ્સને પરવાનગી નથી, જેવા કે:','Arbitrary HTML code.'=>'મનમાનીતો  HTML code','%s item'=>'%s વસ્તુ' . "\0" . '%s વસ્તુઓ','Show tag counts'=>'ટેગની સંખ્યા બતાવો','label for button in the media widgetAdd Media'=>'મીડિયા ઉમેરો','label for button in the video widgetAdd Video'=>'વિડિઓ ઉમેરો','label for button in the image widgetAdd Image'=>'ચિત્ર ઉમેરો','label for button in the audio widgetAdd Audio'=>'ઑડિઓ ઉમેરો','(no author)'=>'(લેખક નથી)','Add to Widget'=>'વિજેટ પર ઉમેરો','Media Widget'=>'મીડિયા વિજેટ','Media Widget (%d)'=>'મીડિયા વિજેટ (%d)' . "\0" . 'મીડિયા વિજેટ (%d)','Video Widget'=>'વિડિઓ વિજેટ','Video Widget (%d)'=>'વિડિઓ વિજેટ (%d)' . "\0" . 'વિડિઓ વિજેટ (%d)','label for butt