istration date for the user.'=>'વપરાશકર્તા માટે નોંધણી તારીખ.','Password for the user (never included).'=>'વપરાશકર્તા માટે પાસવર્ડ (ક્યારેય સમાવેશ થતો નથી).','Username is not editable.'=>'વપરાશકર્તા નામ સંપાદનયોગ્ય નથી.','The role %s does not exist.'=>'ભૂમિકા %s અસ્તિત્વમાં નથી.','Invalid user ID for reassignment.'=>'સોંપણી માટે અમાન્ય વપરાશકર્તા આઈડી.','Sorry, you are not allowed to delete this user.'=>'માફ કરશો, તમને આ વપરાશકર્તા કાઢી નાખવાની મંજૂરી નથી.','You are not currently logged in.'=>'તમે હાલમાં લૉગ ઇન નથી.','Sorry, you are not allowed to edit roles of this user.'=>'માફ કરશો, તમે આ વપરાશકર્તા ની ભૂમિકા ફેરફાર કરવા માટે માન્ય નથી.','Cannot create existing user.'=>'વર્તમાન વપરાશકર્તા બનાવી શકતા નથી.','Sorry, you are not allowed to delete this revision.'=>'માફ કરશો, તમને આ પુનરાવર્તન કાઢી નાખવાની મંજૂરી નથી.','An alphanumeric identifier for the term unique to its type.'=>'અનન્ય ટર્મ ના પ્રકાર માટે આલ્ફાન્યૂમેરિક ઓળખકર્તા.','Limit result set to terms assigned to a specific parent.'=>'ચોક્કસ પેરેન્ટ ને સોંપેલ ટર્મ્સ માટે પરિણામ સેટ મર્યાદિત કરો.','Sort collection by term attribute.'=>'ટર્મ લક્ષણ દ્વારા સંગ્રહનું વર્ગીકરણ કરો.','Type attribution for the term.'=>'ટર્મ માટે એટ્રીબ્યુશન દાખલ કરો.','Limit result set to terms assigned to a specific post.'=>'પરિણામને ચોક્કસ પોસ્ટને સોંપેલ ટર્મ્સ માટે મર્યાદિત કરો.','Whether to hide terms not assigned to any posts.'=>'શું કોઈપણ પોસ્ટને ન સોંપેલ ટર્મ્સ છુપાવવી છે.','The ID for the parent of the revision.'=>'પુનરાવર્તનના પેરેન્ટ માટેનું ID.','HTML description of the term.'=>'ટર્મ માટે એચટીએમએલ(HTML) વર્ણન.','Number of published posts for the term.'=>'ટર્મ માટે પ્રકાશિત પોસ્ટ્સ ની સંખ્યા.','Unique identifier for the user.'=>'વપરાશકર્તા માટે અનન્ય ઓળખકર્તા.','The template cannot be deleted.'=>'નમૂના કાઢી શકાતો નથી.','Status is forbidden.'=>'સ્થિતિ પ્રતિબંધિત છે','Invalid revision ID.'=>'અમાન્ય પુનરાવર્તન આઈડી','Limit result set to items that are sticky.'=>'શોધના પરિણામમાં ફક્ત સ્ટિકિ વસ્તુઓ જ દેખાય એવું કરો.  ','The %s property has an invalid stored value, and cannot be updated to null.'=>'%s લક્ષણ અમાન્ય સંગ્રહાયેલ મૂલ્ય ધરાવે છે, અને તેનું મૂલ્ય null રાખી શકાય નહિ.','Required to be true, as users do not support trashing.'=>'true હોવું જરૂરી છે કારણ કે વપરાશકર્તાઓ ટ્રૅશ ને આધાર આપતા નથી.','Limit results to taxonomies associated with a specific post type.'=>'પરિણામને ચોક્કસ પોસ્ટના પ્રકાર સાથેના વર્ગીકરણ માટે મર્યાદિત કરો.','Whether or not the term cloud should be displayed.'=>'ટર્મ કલાઉડ પ્રદર્શિત થવું જોઈએ કે નહિ.','Offset the result set by a specific number of items.'=>' ચોક્કસ નંબર દ્વારા વસ્તુ નું ઓફસેટ નક્કી કરો .','Limit result set to items with particular parent IDs.'=>'ચોક્કસ પેરેન્ટ આઇડી માટે પરિણામ મર્યાદિત કરો.','Limit result set to posts with a specific menu_order value.'=>'પરિણામને ચોક્કસ menu_order કિંમત સાથેની પોસ્ટ માટે મર્યાદિત કરો.','Limit result set to posts assigned to specific authors.'=>'પરિણામને ચોક્કસ લેખકો સાથેની પોસ્ટ માટે મર્યાદિત કરો.','Limit result set to all items except those of a particular parent ID.'=>'પરિણામોને ચોક્કસ પેરેન્ટ આઇડી સિવાયની તમામ વસ્તુઓ માટે મર્યાદિત કરો.','Ensure result set excludes posts assigned to specific authors.'=>'ખાતરી કરો કે પરિણામોમાં ચોક્કસ લેખકોને સોંપેલ પોસ્ટનો સમાવેશ થતો નથી.','The terms assigned to the post in the %s taxonomy.'=>'%s વર્ગીકરણમાં પોસ્ટને સોંપેલ શરતો.','Limit result set to items except those with specific terms assigned in the %s taxonomy.'=>'%s વર્ગીકરણમાં સોંપેલ ચોક્કસ શરતો સિવાયની આઇટમ્સ પર મર્યાદા પરિણામ સેટ કરો.','A password to protect access to the content and excerpt.'=>'પાસવર્ડ સામગ્રી અને ટૂંકસાર ઍક્સેસ રક્ષણ આપે છે.','Whether the excerpt is protected with a password.'=>'શું ટૂંકસાર પાસવર્ડ સાથે સુરક્ષિત છે.','The format for the post.'=>'પોસ્ટ માટે ફોરમેટ.','The theme file to use to display the post.'=>'થીમ ફાઇલ પોસ્ટ પ્રદર્શિત કરવા માટે ઉપયોગ થાય છે.','Whether or not comments are open on the post.'=>'ટિપ્પણીઓ પોસ્ટ પર ખુલ્લી હોય કે ન હોય.','The ID of the featured media for the post.'=>'પોસ્ટ માટે ફીચર્ડ મીડિયાનું આઈડી.','Whether or not the post can be pinged.'=>'પોસ્ટને પિંગ કરી શકાય કે નહીં.','Whether or not the post should be treated as sticky.'=>'પોસ્ટને સ્ટીકી ગણવી જોઈએ કે નહીં.','HTML excerpt for the post, transformed for display.'=>'પોસ્ટ માટે HTML ટૂંકસાર, પ્રદર્શન માટે રૂપાંતરિત.','The title for the object.'=>'ઓબ્જેકટ માટે શીર્ષક.','Whether the content is protected with a password.'=>'શું સામગ્રી પાસવર્ડ સાથે સુરક્ષિત છે.','Excerpt for the post, as it exists in the database.'=>'પોસ્ટ માટે ટૂંકસાર, જે પ્રમાણે તે ડેટાબેઝ માં અસ્તિત્વમાં છે.','Title for the post, as it exists in the database.'=>'પોસ્ટ માટે શીર્ષક, ડેટાબેઝમાં જે પ્રમાણે છે તે પ્રમાણે.','The excerpt for the post.'=>'પોસ્ટ માટે ટૂંકસાર.','The ID for the author of the post.'=>'પોસ્ટના લેખક માટે ID.','A named status for the post.'=>'પોસ્ટ માટે નામવાળી સ્થિતિ.','An alphanumeric identifier for the revision unique to its type.'=>'પુનરાવર્તન માટે આલ્ફાન્યૂમેરિક ઓળખકર્તા તેના પ્રકાર માટે અનન્ય છે.','HTML title for the post, transformed for display.'=>'પોસ્ટ માટે HTML શીર્ષક, પ્રદર્શન માટે રૂપાંતરિત.','Invalid featured media ID.'=>'અમાન્ય ફીચર્ડ મીડિયા આઈડી.','A password protected post can not be set to sticky.'=>'પાસવર્ડ સુરક્ષિત પોસ્ટ ને સ્ટીકી સેટ નહી કરી શકો.','A sticky post can not be password protected.'=>'એક સ્ટીકી પોસ્ટ પાસવર્ડ સુરક્ષિત કરી શકાતી નથી.','Invalid post parent ID.'=>'અમાન્ય પોસ્ટ પેરેન્ટ આઈડી.','GUID for the revision, as it exists in the database.'=>'પુનરાવર્તન માટે GUID, કારણ કે તે ડેટાબેઝમાં અસ્તિત્વ ધરાવે છે.','GUID for the post, transformed for display.'=>'પોસ્ટ માટે GUID, પ્રદર્શન માટે રૂપાંતરિત.','The globally unique identifier for the post.'=>'પોસ્ટ માટે વૈશ્વિક સ્તરે અનન્ય ઓળખકર્તા.','The date the revision was last modified, as GMT.'=>'GMT તરીકે, પુનરાવર્તનમાં છેલ્લે ફેરફાર કરવામાં આવ્યો તે તારીખ.','The date the revision was published, as GMT.'=>'GMT તરીકે પુનરાવર્તન પ્રકાશિત કરવામાં આવ્યું તે તારીખ.','The date the revision was last modified, in the site\'s timezone.'=>'સાઇટના ટાઇમઝોનમાં, પુનરાવર્તનમાં છેલ્લે ફેરફાર કરવામાં આવ્યો તે તારીખ.','The date the revision was published, in the site\'s timezone.'=>'સાઇટના ટાઇમઝોનમાં, પુનરાવર્તન પ્રકાશિત કરવાની તારીખ.','Cannot create existing post.'=>'હાલની પોસ્ટ બનાવી શકાતી નથી.','The post has already been deleted.'=>'પોસ્ટ પહેલેથી જ કાઢી નાખવામાં આવી છે.','A post can not be sticky and have a password.'=>'પોસ્ટ સ્ટીકી અને પાસવર્ડ સુરક્ષિત ન હોઇ શકે.','Sorry, you are not allowed to create new users.'=>'માફ કરશો, તમને નવા વપરાશકર્તાઓ બનાવવા માટે મંજૂરી નથી.','Sorry, you are not allowed to manage this plugin.'=>'માફ કરશો, તમને આ પ્લગઇન મેનેજ કરવાની મંજૂરી નથી.','Sorry, you are not allowed to edit comments.'=>'માફ કરશો, તમે ટિપ્પણીઓ સંપાદિત કરવાની મંજૂરી નથી.','The password for the post if it is password protected.'=>'પોસ્ટ માટે પાસવર્ડ જો તે પાસવર્ડ સુરક્ષિત છે.','You need to define a search term to order by relevance.'=>'તમારે સુસંગતતા દ્વારા ઓર્ડર કરવા શોધ ટર્મ વ્યાખ્યાયિત કરવી જરૂર છે.','Incorrect post password.'=>'પોસ્ટ પાસવર્ડ ખોટો છે.','A human-readable description of the taxonomy.'=>'વર્ગીકરણનું એક માનવ વાંચનીય વર્ણન.','An alphanumeric identifier for the user.'=>'વપરાશકર્તા માટે એક આલ્ફાન્યૂમેરિક ઓળખકર્તા.','Human-readable labels for the taxonomy for various contexts.'=>'વિવિધ સંદર્ભોમાં વર્ગીકરણ માટે માનવ વાંચનીય લેબલ.','Whether posts with this status should be protected.'=>'શું આ સ્થિતિ સાથે પોસ્ટ્સ સુરક્ષિત થવો જોઈએ.','All capabilities used by the taxonomy.'=>'વર્ગીકરણ દ્વારા ઉપયોગ થતી બધી ક્ષમતાઓ.','Whether or not the taxonomy should have children.'=>'વર્ગીકરણને ચિલ્ડ્રન હોવા જોઈએ કે નહિ.','Whether posts of this status should be shown in the front end of the site.'=>'શું આ સ્થિતિની પોસ્ટ્સ આ સાઈટ ના ફ્રન્ટએન્ડમાં પ્રદર્શિત થવી જોઈએ.','Whether to include posts in the edit listing for their post type.'=>'શું પોસ્ટને તેના પોસ્ટ પ્રકારની સંપાદિત કરેલ યાદી માં સમાવેશ કરવો છે.','Whether posts with this status should be publicly-queryable.'=>'શું આ સ્થિતિ સાથેના પોસ્ટ્સ publicly-queryable હોવા જોઈએ.','Sorry, you are not allowed to manage post statuses.'=>'માફ કરશો, તમને પોસ્ટ સ્થિતિનું સંચાલન કરવાની મંજૂરી નથી.','Maximum number of items to be returned in result set.'=>'મહત્તમ સંખ્યાની વસ્તુઓ પરિણામ સેટ પરત કરી શકાય છે.','Scope under which the request is made; determines fields present in response.'=>'જે અવકાશ હેઠળ વિનંતી કરવામાં આવી છે; તે જવાબમાં હાજર ક્ષેત્રો નક્કી કરે છે.','Method \'%s\' not implemented. Must be overridden in subclass.'=>'પદ્ધતિ \'%s\' અમલમાં મૂકાઈ નથી. પેટાવર્ગ માં ફરીથી લખાયેલું હોવું જ જોઈએ','Current page of the collection.'=>'સંગ્રહનું વર્તમાન પેજ.','Whether posts with this status should be private.'=>'શું આ સ્થિતિ સાથે પોસ્ટ્સ ખાનગી થવો જોઈએ.','Limit results to those matching a string.'=>'પરિણામોને મેચિંગ સ્ટ્રીંગ સુધી મર્યાદિત કરો.','Order sort attribute ascending or descending.'=>'attribute ને ચડતાં અથવા ઉતરતા ક્ર્મ મા ગોથવો.','Sort collection by object attribute.'=>'સંગ્રહ ને ઓબ્જેક્ટ ના લક્ષણ પ્રમાણે ગોથવો.','Ensure result set excludes specific parent IDs.'=>'ખાતરી કરો પરિણામ સેટ માં ચોક્કસ પેરેન્ટ આઇડી નો સમાવેશ થતો નથી.','Limit result set to comments assigned a specific type. Requires authorization.'=>'પરિણામોને ચોક્કસ પ્રકારની ટિપ્પણીઓ માટે માર્યાદિત કરો. અધિકૃતતાની જરૂર છે.','Limit result set to comments of specific parent IDs.'=>'પરિણામોને ચોક્કસ પેરેન્ટ આઇડી સાથેની ટિપ્પણીઓ માટે મર્યાદિત કરો.','Limit result set to comments assigned a specific status. Requires authorization.'=>'પરિણામોને ચોક્કસ સ્થિતિ સાથેની ટિપ્પણીઓ માટે મર્યાદિત કરો. અધિકૃતતાની જરૂર છે.','Limit result set to comments assigned to specific post IDs.'=>'પરિણામને ચોક્કસ પોસ્ટ આઈડીઓને સોંપેલ ટિપ્પણીઓ માટે મર્યાદિત કરો.','Ensure result set excludes specific IDs.'=>'ખાતરી કરો પરિણામ સમૂહમાં ચોક્કસ આઇડી નો સમાવેશ થતો નથી.','Avatar URL with image size of %d pixels.'=>'%d પિક્સેલ્સ ચિત્ર માપ સાથે અવતાર યુઆરએલ(URL).','Limit result set to specific IDs.'=>'ચોક્કસ આઇડી માટે પરિણામ મર્યાદિત કરો.','Ensure result set excludes comments assigned to specific user IDs. Requires authorization.'=>'ખાતરી કરો પરિણામ સેટ માં ચોક્કસ વપરાશકર્તા આઈડી ને સોંપેલ ટિપ્પણીઓ નો સમાવેશ થતો નથી. અધિકૃતતાની જરૂર છે.','Limit result set to comments assigned to specific user IDs. Requires authorization.'=>'પરિણામોને ચોક્કસ વપરાશકર્તા આઇડી સાથેની ટિપ્પણીઓ માટે મર્યાદિત કરો.અધિકૃતતાની જરૂર છે.','Limit result set to that from a specific author email. Requires authorization.'=>'પરિણામોને ચોક્કસ લેખકના ઇમેઇલ માટે મર્યાદિત કરો. અધિકૃતતાની જરૂર છે.','Limit response to posts published before a given ISO8601 compliant date.'=>'આપેલ ISO8601 સુસંગત તારીખ પહેલાં પ્રકાશિત પોસ્ટ માટે જવાબ મર્યાદિત કરો.','Limit response to posts published after a given ISO8601 compliant date.'=>'આપેલ ISO8601 સુસંગત તારીખ પછી પ્રકાશિત પોસ્ટ માટે જવાબ મર્યાદિત કરો.','Avatar URLs for the comment author.'=>'ટિપ્પણી લેખક માટે અવતાર URL.','The ID of the associated post object.'=>'સંકળાયેલ પોસ્ટ ઓબ્જેક્ટ નો આઈડી.','URL to the object.'=>'ઓબ્જેકટ માટે યુઆરએલ(URL) છે.','The content for the post.'=>'પોસ્ટનું લખાણ.','State of the comment.'=>'ટિપ્પણીની સ્થિતિ.','The date the post was published, as GMT.'=>'GMT તરીકે પોસ્ટ પ્રકાશિત કરવામાં આવી તે તારીખ.','HTML content for the post, transformed for display.'=>'પોસ્ટ માટે HTML સામગ્રી, પ્રદર્શન માટે રૂપાંતરિત.','Content for the post, as it exists in the database.'=>'પોસ્ટ માટેની સામગ્રી, કારણ કે તે ડેટાબેઝમાં અસ્તિત્વમાં છે.','The ID for the parent of the post.'=>'પોસ્ટના માતાપિતા માટેનું ID.','The comment cannot be deleted.'=>'ટિપ્પણી કાઢી શકાતી નથી.','The comment has already been trashed.'=>'ટિપ્પણી પહેલેથી ટ્રેશ કરવામાં આવી છે.','Invalid comment author ID.'=>'અમાન્ય ટિપ્પણી લેખક આઈડી.','The ID of the user object, if author was a user.'=>'વપરાશકર્તા ઓબ્જેક્ટ ID, જો લેખક વપરાશકર્તા હતા.','Unique identifier for the object.'=>'ઓબ્જેક્ટ માટે અનન્ય ઓળખકર્તા.','IP address for the comment author.'=>'ટિપ્પણી લેખક માટે IP સરનામું.','User agent for the comment author.'=>'ટિપ્પણી લેખક માટે વપરાશકર્તા એજન્ટ.','Display name for the comment author.'=>'ટિપ્પણી લેખક માટે નામ દર્શાવો.','Email address for the comment author.'=>'ટિપ્પણી લેખક માટે ઇમેઇલ સરનામું.','URL for the comment author.'=>'ટિપ્પણી લેખક માટે URL.','Updating comment failed.'=>'ટિપ્પણીઓ સુધારવું નિષ્ફળ.','Updating comment status failed.'=>'ટિપ્પણી પરિસ્થિતિ સુધારવું નિષ્ફળ.','Creating a comment requires valid author name and email values.'=>'એક ટિપ્પણી બનાવા માટે માન્ય લેખકનું નામ અને ઇમેઇલ જરૂરી છે.','Cannot create existing comment.'=>'હાલની ટિપ્પણી બનાવી શકતા નથી.','Creating comment failed.'=>'ટિપ્પણી બનાવી નિષ્ફળ.','Sorry, you must be logged in to comment.'=>'માફ કરશો, ટિપ્પણી માટે તમારે પ્રવેશે કરવો પડશે.','Query parameter not permitted: %s'=>'ક્વેરી પરિમાણને પરવાનગી નથી: %s','Could not open file handle.'=>'ફાઇલ હેન્ડલ ખોલી શકાતી નથી.','No data supplied.'=>'કોઈ ડેટા પૂરો પાડવામાં આવ્યો નથી.','No Content-Disposition supplied.'=>'કોઈ સામગ્રી નિકાલ પૂરી પાડવામાં આવી નથી.','No Content-Type supplied.'=>'કોઈ સામગ્રી પ્રકાર પૂરી પાડવામાં આવી નથી.','Content hash did not match expected.'=>'કન્ટેન્ટ હેશ(content hash) અપેક્ષા સાથે મેળ ખાતી નથી.','Limit result set to attachments of a particular MIME type.'=>'ચોક્કસ MIME પ્રકાર ના જોડાણો માટે પરિણામ મર્યાદિત કરો.','Limit result set to attachments of a particular media type.'=>'ચોક્કસ મીડિયા પ્રકારના અટેચમેન્ટ માટે પરિણામ મર્યાદિત કરો.','The ID for the associated post of the attachment.'=>'અટેચમેન્ટ સાથે સંકળાયેલ પોસ્ટ માટે આઈડી.','Invalid Content-Disposition supplied. Content-Disposition needs to be formatted as `attachment; filename="image.png"` or similar.'=>'અમાન્ય Content-Disposition પૃરુ પાડવામાં આવ્યું છે. Content-Disposition `attachment; filename="image.png"` અથવા સમાન તરીકે ફોર્મેટ કરવાની જરૂર છે.','Whether to bypass Trash and force deletion.'=>'શું ટ્રૅશને બાયપાસ કરવું અને કાઢી નાખવાનું દબાણ કરવું.','Page Attributes'=>'પેજ લક્ષણો','Invalid parent type.'=>'અમાન્ય પેરેન્ટ પ્રકાર','Sorry, you are not allowed to upload media on this site.'=>'માફ કરશો, તમને આ સાઇટ પર મીડિયા અપલોડ કરવા માટે પરવાનગી નથી.','Alternative text to display when attachment is not displayed.'=>'વૈકલ્પિક લખાણ દર્શાવવા માટે જ્યારે અટેચમેન્ટ પ્રદર્શિત નથી.','Sorry, you are not allowed to upload media to this post.'=>'માફ કરશો, તમને આ પોસ્ટ માટે મીડિયા અપલોડ કરવાની પરવાનગી નથી.','Details about the media file, specific to its type.'=>'મીડિયા ફાઈલ વિશે વિગતો, તેના ચોક્કસ પ્રકાર માટે.','The REST API can no longer be completely disabled, the %s filter can be used to restrict access to the API, instead.'=>'REST API હવે સંપૂર્ણપણે અક્ષમ કરી શકાશે નહીં, તેના બદલે %s ફિલ્ટરનો ઉપયોગ API ની ઍક્સેસને પ્રતિબંધિત કરવા માટે થઈ શકે છે.','View Posts'=>'પોસ્ટ્સ જુઓ','Post Attributes'=>'પોસ્ટ લક્ષણો','All Changesets'=>'બધા ચેન્જસેટ','View Changeset'=>'ચેન્જસેટ જુઓ','View Pages'=>'પૃષ્ઠો જુઓ','No changesets found.'=>'કોઈ ચેન્જસેટ(changeset) મળ્યા નથી.','No changesets found in Trash.'=>'કોઈ ચેન્જસેટ(Changeset) ટ્રૅશમાં મળ્યા નથી.','Search Changesets'=>'ચેન્જસેટ(Changeset) શોધો','New Changeset'=>'નવો ચેન્જસેટ(Changeset)','Edit Changeset'=>'ચેન્જસેટ(Changeset) સંપાદિત કરો','Attachment Attributes'=>'જોડાણ લક્ષણો','post type general nameChangesets'=>'ચેન્જસેટ','post type singular nameChangeset'=>'ચેન્જસેટ','Custom CSS'=>'કસ્ટમ સીએસએસ(CSS)','%1$s %2$s, %3$s ago (%4$s)'=>'%1$s %2$s, %3$s પહેલા (%4$s)','The "%s" options group has been removed. Use another settings group.'=>'"%s" વિકલ્પ જૂથ દૂર કરવામાં આવ્યું છે. અન્ય સેટિંગ જૂથ વાપરો.','WordPress locale code.'=>'વર્ડપ્રેસ લોકેલ કોડ','A date format for all date strings.'=>'બધા તારીખ શબ્દમાળાઓ માટે એક તારીખ ફોર્મેટ.','A time format for all time strings.'=>'બધા સમય શબ્દમાળાઓ માટે એક સમય બંધારણ.','Default post format.'=>'મૂળભૂત પોસ્ટ ફોર્મેટ.','Blog pages show at most.'=>'બ્લોગ પાનું વધુ દર્શાવે છે.','A day number of the week that the week should start on.'=>'અઠવાડિયા નો દિવસ ક્રમાંક જેના થી અઠવાડિયુ શરુ થશે.','Allow link notifications from other blogs (pingbacks and trackbacks) on new articles.'=>'નવા લેખો પર અન્ય બ્લોગના લિંક સૂચનો (પિંગબેક્સ અને ટ્રૅકબેક્સ) ને પરવાનગી આપો.','C