 કોઈ બીજું નામ વાપરો.','The site you were looking for, %s, does not exist.'=>'જે સાઈટ આપ શોધી રહ્યા છો, %s, અસ્તિત્વમાં નથી','It looks like nothing was found at this location. Maybe try visiting %s directly?'=>'એવું જણાય છે કે આ સ્થળે કશું મળ્યું નથી. કદાચ સીધું %s ચકાસવાનો પ્રયાસ કરશો?','Continue reading %s'=>'વાંચન ચાલુ રાખો %s','Oops! That embed cannot be found.'=>'અરે! તે એમ્બેડ શોધી શકાતું નથી.','Site Language:'=>'સાઈટની ભાષા','Mission complete. Message %s deleted.'=>'મીશન પૂરું થયું. મેસેજ %s ડિલીટ કરી નાખવામાં આવ્યો છે.','Posted title:'=>'પોસ્ટ કરેલું શીર્ષક:','Author:'=>'લેખક','Error reconnecting to the database'=>'ડેટાબેઝ સાથે ફરી જોડવા માં ભુલ છે ','If you are unsure what these terms mean you should probably contact your host. If you still need help you can always visit the <a href="%s">WordPress support forums</a>.'=>'જો તમને આ શબ્દોનો અર્થ ખબર નથી તો તમારે કદાચ તમારા હોસ્ટનો સંપર્ક કરવો જોઈએ. જો તમને હજુ પણ મદદની જરૂર હોય તો <a href="%s">વર્ડપ્રેસ સર્પોટ ફોરમ્સની</a> મુલાકાત લો.','Are you sure the database server is not under particularly heavy load?'=>'શું તમને ખાતરી છે કે ડેટાબેઝ સર્વર ખાસ કરીને ભારે ભાર હેઠળ નથી?','Are you sure you have typed the correct hostname?'=>'શું તમને ખાતરી છે કે તમે સાચું હોસ્ટનામ ટાઇપ કર્યું છે?','Are you sure the database server is running?'=>'શું તમને ખાતરી છે કે ડેટાબેઝ સર્વર ચાલી રહ્યું છે?','This means that the contact with the database server at %s was lost. This could mean your host&#8217;s database server is down.'=>'આનો અર્થ એ થયો કે %s પર ડેટાબેઝ સર્વર સાથેનો સંપર્ક ખોવાઈ ગયો હતો. આનો અર્થ એ થઈ શકે છે કે તમારા હોસ્ટનું ડેટાબેઝ સર્વર ડાઉન છે.','Are you sure you have the correct username and password?'=>'શું આપને ખાત્રી છે કે આપ સાચુ યુઝર નેમ(username) અને પાસવર્ડ ધરાવો છો?','This either means that the username and password information in your %1$s file is incorrect or that contact with the database server at %2$s could not be established. This could mean your host&#8217;s database server is down.'=>'આનો અર્થ એ છે કે તમારી %1$s ફાઇલમાં વપરાશકર્તાનામ અને પાસવર્ડ માહિતી ખોટી છે અથવા %2$s પર ડેટાબેઝ સર્વર સાથેનો સંપર્ક સ્થાપિત કરી શકાયો નથી. આનો અર્થ એ થઈ શકે છે કે તમારા હોસ્ટનું ડેટાબેઝ સર્વર ડાઉન છે.','If you do not know how to set up a database you should <strong>contact your host</strong>. If all else fails you may find help at the <a href="%s">WordPress support forums</a>.'=>'જો તમને ડેટાબેઝ કેવી રીતે સેટ કરવો તે ખબર નથી, તો તમારે <strong>તમારા હોસ્ટનો સંપર્ક કરવો જોઈએ</strong>. જો બીજું બધું નિષ્ફળ જાય તો તમને <a href="%s">વર્ડપ્રેસ સપોર્ટ ફોરમ</a> પર મદદ મળી શકે છે.','Are you sure it exists?'=>'શું આપને ખાત્રી છે કે તે અસ્તિત્વમાં છે?','Does the user %1$s have permission to use the %2$s database?'=>'%1$s યુઝર(user) ને %2$s ડેટાબેઝ વાપરવા માટેની પરવાનગી છે?','On some systems the name of your database is prefixed with your username, so it would be like <code>username_%1$s</code>. Could that be the problem?'=>'કેટલીક સિસ્ટમો પર તમારા ડેટાબેઝ નું નામ યૂસરનેમ સાથે પૂર્વગ હોઈ છે, તેથી તે  <code>username_%1$s</code> જેવું હોઈ શકે. એ સમસ્યા હોઈ શકે?','The tag cloud will not be displayed since there are no taxonomies that support the tag cloud widget.'=>'ટેગ કલાઉડ દેખાશે નહિ કેમકે ત્યાં કોઇપણ તેક્ષોનોમિસ નથી કે જે ટેગ કલાઉડ વિદ્જેત પર આધાર  રાખતી હોય','Nicename may not be longer than 50 characters.'=>'નાઈસનેમ(Nicename) ૫૦ અક્ષરો કરતા લાંબો હોઈ શકે નહિં.','<strong>Error:</strong> The password you entered for the username %s is incorrect.'=>'<strong>ભૂલ:</strong> તમે વપરાશકર્તાનામ %s માટે દાખલ કરેલ પાસવર્ડ ખોટો છે.','Categories list navigation'=>'શ્રેણીઓ યાદી સંશોધક','Tags list'=>'ટૅગ્સ યાદી','Tags list navigation'=>'ટૅગ્સ યાદી નેવિગેશન','Categories list'=>'કૈટગોરીસ ની સૂચિ ','%1$s (since %2$s; %3$s)'=>'%1$s (ત્યારથી %2$s; %3$s)','Invalid shortcode name: Empty name given.'=>'અમાન્ય શોર્ટકોડ નામ: ખાલી નામ આપવામાં આવેલ છે.','Invalid shortcode name: %1$s. Do not use spaces or reserved characters: %2$s'=>'અમાન્ય શોર્ટકોડ નામ: %1$s. જગ્યાઓ અથવા અનામત અક્ષરો વાપરો નહિં: %2$s','%1$s (since %